import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to appear
    await page.waitForSelector('#productsGrid .product-card', { timeout: 5000 });

    // Click the first product card to open product detail modal
    const firstProductCard = await page.$('#productsGrid .product-card');
    await firstProductCard.click();

    // Wait for the product detail modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('#productModal .add-to-wishlist', { timeout: 5000 });

    // Take screenshot of product detail modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_detail.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_detail.png'));

    // Click the "Add to Wish List" button
    const addToWishlistBtn = await page.$('#productModal .add-to-wishlist');
    await addToWishlistBtn.click();

    // Wait for notification to appear
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_wishlist.png'));

    // Close the product modal (click the close button)
    const closeBtn = await page.$('#productModal .close');
    if (closeBtn) {
      await closeBtn.click();
      // Wait for modal to disappear
      await page.waitForSelector('#productModal', { state: 'hidden', timeout: 5000 });
    }

    // Go to the wishlist page
    // Try to find a link or button with text "Your Wish List"
    let wishlistLink = await page.$('a:text("Your Wish List")');
    if (!wishlistLink) {
      // Try another selector (since there are multiple, pick the first visible one)
      const wishlistLinks = await page.$$('a');
      for (const link of wishlistLinks) {
        const text = await link.innerText();
        if (text && text.trim() === "Your Wish List") {
          wishlistLink = link;
          break;
        }
      }
    }
    if (wishlistLink) {
      await wishlistLink.click();
    } else {
      // If no link, try calling the showWishlist function directly
      await page.evaluate(() => { if (window.showWishlist) window.showWishlist(); });
    }

    // Wait for the wishlist page to render
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });
    await page.waitForSelector('.wishlist-items', { timeout: 5000 });

    // Take screenshot of wishlist page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_page.png'));

    // Extract wishlist items' titles for verification
    const wishlistTitles = await page.$$eval('.wishlist-item .wishlist-title', nodes =>
      nodes.map(n => n.innerText.trim())
    );

    return {
      success: true,
      action: "Added first product to wishlist and verified it appears in the wishlist page",
      extractedData: {
        wishlistTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
